geregisseerd door Juan Diego Solanas
met Kirsten Dunst, Jim Sturgess en Jayne Heitmeyer

Adam (Jim Sturgess) is een op het eerste gezicht doodgewone man, maar er is meer met hem aan de hand. Adam verlangt namelijk nog altijd naar zijn geliefde Eve (Kirsten Dunst), die hij kent uit een andere tijd en andere wereld. 
Hij heeft zich bijna neergelegd bij het feit dat hij haar nooit meer zal zien, wanneer hij haar op televisie ziet. 
Hij begint zijn onconventionele zoektocht.



